		{
			"_uuid": "e4898c958d70423f824e1eb3c0b13c34",
			"current_frame": "normal",
			"custom": true,
			"label": "kinguin",
			"on_create": "if(not level.player.get_stored_event('town_elder_fight_won'),remove_object(me))",
			"on_talk": "
				if(had_conversation_with_me_already__section('long_recap'),
					speech_dialog(
								set(level.player.animation, 'emote_raisedfinger'),
				level.player,	[~Hello again.~],
				self,			[~Hey there.~],
					),
				
					
					
					
					[record_having_conversation__section('long_recap'),
					speech_dialog(
							set(level.player.animation, 'emote_raisedfinger'),
			level.player,	[~Wow, so they seriously just packed up and left?\\nThat's amazing!~],
			self,			[~Tell me about it.~],
							set(level.player.animation, 'emote_confused'),
			level.player,	[~So, how did you get out of your cage?~],
			self,			[~Well, they just let me out.~],
							set(level.player.animation, 'emote_oh'),
			level.player,	[~What?!\\nThey ... as in Milgram's kitties?~],
			self,			[~Yeah... it doesn't make any sense!\\nWhy would they just let me go?~, 
								~Because I gave their leader THE BUSINESS!~, [speech_dialog(
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~Because I gave their leader THE BUSINESS!~],
					self,			[~Seriously?  Badass!~],
									set(level.player.animation, 'emote_nod'),
					level.player,	[~I try.~],
					self,			[~This was that kitty with the sword?\\nThe one who came walking out?~],
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~Yup.\\nI kicked his ass.~],
									set(level.player.animation, 'emote_talk'),
									[~Far as I can tell,\\nhe was holding up the elder.~],
					self,			[~Yeah, I heard a bunch of it.~],
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~Anyways, as you may have heard,\\nI'm going on a little trip, here.~],
									set(level.player.animation, 'emote_oh'),
									[~Yeah, I'm a little worried about\\nwhat might happen if someone doesn't\\nget in touch with Milgram.~],
									set(level.player.animation, 'emote_impatient'),
									[~That old clown was just sabre-rattling\\nabout raising a militia.~],
					self,			[~You don't think he could actually\\npull that off, do you?~,
										~Nah, we're a little too laid back.~, [speech_dialog(
												set(level.player.animation, 'emote_confused'),
								level.player,	[~Nah, we're a little too laid back.\\nWe're a bunch of pushovers, thank goodness.~], 
								self,			[~I can't imagine the alternative.\\nIt'd be a horrible way to live.~],
												set(level.player.animation, 'emote_geez'),
								level.player,	[~I guess I'm also worried about the other end;\\nwhat Milgram is doing, et cetera.~],
												set(level.player.animation, 'emote_raisedfinger'),
												[~If they really are up to no good,\\nI can at least get some intel.~],
										)],
										~Enough to cause some tragedy.~, [speech_dialog(
												set(level.player.animation, 'emote_oh'),
								level.player,	[~I think he could manage enough\\nto cause some small tragedy.~], 
												set(level.player.animation, 'emote_geez'),
												[~Even if he just schmucks a few\\nidiots into fighting, that's enough.~],
												set(level.player.animation, 'emote_confused'),
												[~That's still a few untimely deaths.~], 
												set(level.player.animation, 'emote_geez'),
												[~I might wish that on <em>him</em>,\\nbut not on anyone else.~],
								self,			[~Yeah, I see what you mean.~],
												[~You think you'd be able to forestall this?~],
												set(level.player.animation, 'emote_confused'),
								level.player,	[~Maybe? If I got Milgram some\\nadvance warning, who knows?~], 
										)],
									],
									set(level.player.animation, 'emote_confused'),
					level.player,	[~I don't know; it's a little crazy to do this,\\nbut I've kinda been itching for something\\nworthwhile to do.~],
									set(level.player.animation, 'emote_raisedfinger'),
									[~Good excuse to get out and travel a bit.\\nSee the island.~],
					self,			[~Risky business, though, isn't it?~],
									set(level.player.animation, 'emote_talk'),
					level.player,	[~Oh, no question.~],
									set(level.player.animation, 'emote_geez'),
									[~Though... it <em>cannot</em> be worse than what\\nI have to deal with just coming into town.~],
									set(level.player.animation, 'emote_confused'),
									[~Who knows?\\nMaybe something good will come of it?~],
					self,			[~Well, good luck!\\nI'll be around.~]
					)],
								~Because of your winning smile?~, [speech_dialog(
									set(level.player.animation, 'emote_raisedfinger'),
					level.player,	[~Because of your winning smile?~],
					self,			[~Haha, sure.~],
									[~Still, though, that just seems\\nlike an enormous waste of effort.~],
									set(level.player.animation, 'emote_confused'),
					level.player,	[~Yeah, this whole day has just been ... bizarre.~], 
					self,			[~I've been thinking about that part,\\nand I have a hunch.~],
									[~I think the rank-and-file weren't\\ngiven very specific orders.~],
									[~I think they were just told to secure\\nthe place, and the higher-ups would\\nthen find what they really were after.~],
									[~Just arresting everyone is a strange way\\nto do it, but I guess it's not so weird\\nif you've got lots of manpower to spare.~],
									[~If they were just looking for the elder\\nand didn't care about ticking people off,\\nit's one way to make sure he couldn't slip away.~],
									[~I mean, I don't know...\\nwhat do you think?~,
											~Is that really who they were after?~, [speech_dialog(
													set(level.player.animation, 'emote_confused'),
									level.player,	[~Well, is that really who they were after?~],
									self,			[~Yeah, one of their head guys showed me\\na drawing of him.~],
													[~He asked me if I knew who it was.~],
													set(level.player.animation, 'emote_confused'),
									level.player,	[~That's very interesting...~],
													set(level.player.animation, 'emote_raisedfinger'),
													[~Suddenly their motives don't seem\\nso cut and dry.~],
													set(level.player.animation, 'emote_talk'),
													[~Strange..~],
												)],
											~Nah, that still seems crazy.~,	 [speech_dialog(
													set(level.player.animation, 'emote_geez'),
									level.player,	[~Nah, that still seems crazy.\\nSorry.~],
									self,			[~Yeah, fair enough - it's just a theory.~],
													[~It's pretty weird even if there <em>is</em>\\nsome rational explanation.~],
													set(level.player.animation, 'emote_geez'),
									level.player,	[~I mean, it could just be caprice.\\nThere's no guarantee they're being logical.~],
													set(level.player.animation, 'emote_confused'),
													[~Seriously loopy stuff can happen when\\nlarge groups blindly follow orders.~],
									self,			[~Yeah, no kidding.~],
												)],
											~What would they want from him?~, [speech_dialog(
													set(level.player.animation, 'emote_confused'),
									level.player,	[~I don't understand, though...\\nWhat would they want from <em>him?</em>~],
									self,			[~He actually said the same thing you heard...~],
													[~That the elder had stolen\\na bunch of money from Milgram.~],
													set(level.player.animation, 'emote_nod'),
									level.player,	[~Well, at least they're not changing\\ntheir story around on us.~],
													set(level.player.animation, 'emote_geez'),
													[~Because if they do, it's a\\ndead-ringer that someone's lying.~],
												)],
									],
									set(level.player.animation, 'emote_confused'),
					level.player,	[~Anyways, I'd better run.\\nLet's hope nothing else happens!~],																	
					self,			[~Stay out of trouble, eh?~],																	
					)],
								~Well... how should I know?~, [speech_dialog(
									set(level.player.animation, 'emote_geez'),
					level.player,	[~Well... how should I know?~],
					self,			[~Ahh, I don't know...\\nThis is all so crazy.~],
									[~Really makes you wonder...\\nI mean, what's gonna happen next, huh?~],
									set(level.player.animation, 'emote_confused'),
					level.player,	[~Yeah, it's a scary world we live in.~],
									set(level.player.animation, 'emote_raisedfinger'),
									[~Stay safe, alright?~],
					self,			[~Sure thing.~]
															)],
								], 

							
				)])",
